import React from 'react'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

import Navbar from './components/Navbar';
import Slider from './components/Slider';
import Card from './components/Card';

const App = () => {
  return (
    <>
    <Router>
    <Navbar />
      <Routes>
        <Route path="/home"/>
        <Route path="/contact"/>
        <Route path="/service"/>

        <Route path="/home"/>


        <Route path="/about"/>
      </Routes>
      <Slider/>
      <Card/>
      </Router>
    </>
  )
}

export default App;
